public static List<String> notEmptyElements(List<String> list, String name) {
  notNull(list, name);
  for (int i = 0; i < list.size(); i++) {
    notEmpty(list.get(i), MessageFormat.format("list [{0}] element [{1}]", name, i));
  }
  return list;
}
